import React from "react";
import { Button, Form, FormControl } from "react-bootstrap";

const Search = () => {
  return (
    <>
      <Form inline className="search">
        <FormControl
          type="text"
          placeholder="Search"
          className="mr-sm-2 searchbar"
        />
        <Button variant="dark" block className="btn-search">
          Search
        </Button>
      </Form>
    </>
  );
};

export default Search;
